import Head from 'next/head';
import Landing from "../component/About/landing";

export default function about() {
    return (
        <Layout>
            <Head>
                <title>Techronx |  About</title>
            </Head>
        <div>
           <Landing />
        </div>
        </Layout>
    )
}
